script: |
  super -f text -I q5173.spq | sort > q5173.out

inputs:
  - name: q5173.spq
    data: |
      SELECT DISTINCT + col2 AS col2 FROM tab1 (FORMAT parquet) WHERE - + col2 NOT BETWEEN + + col0 * col2 AND ( + 82 );
  - name: tab1

outputs:
  - name: q5173.out
    data: |
      59
      68
      96
